import requests
import json

url = "http://192.168.1.201/cgi-bin/FaceInfoManager.cgi?action=update"

payload = json.dumps({
  "UserID": "1",
  "Info": {
    "UserName": "Helvio",
    "PhotoData": [
      ""
    ]
  }
})
headers = {
  'Content-Type': 'application/json',
  'Cookie': 'secure'
}

response = requests.request("POST", url, headers=headers, data=payload)

print(response.text)
